import React from 'react';
import { Link } from 'react-router-dom';

const DashBoardActions = () => {
  return (
    <div className="dash-buttons">
        <Link to="/edit-profile" className="btn btn-light"
          ><i className="fas fa-user-circle fa-2x text-primary m-1"></i>Edit Profile</Link>
        <Link to="/add-experience" className="btn btn-light"
          ><i className="fab fa-black-tie text-primary m-1"></i>Add Experience</Link>
        <Link to="/add-education" className="btn btn-light"
          ><i className="fas fa-graduation-cap text-primary m-1"></i>Add Education</Link>
      </div>
  )
}

export default DashBoardActions;
